import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  padding-top: 100px;
`;

const CourseHeader = styled.div`
  width: 300px;
  height: 50px;
  color: black;
  font-size: 15pt;
  border: 1px solid black;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 100px;
`;

const DividerW = () => (
  <Container>
    <CourseHeader>실시간 원격 코스 진행 방식</CourseHeader>
    <AvatarContainer>
      <AvatarContainerColumn className="right_img">
        <AvatarImg
          src={require('../../Assets/Images/youngman/group29.png')}
        ></AvatarImg>
      </AvatarContainerColumn>
      <AvatarContainerColumn className="left_text">
        <AvatarDescription>
          이제 인터넷 강의는 지긋지긋해요 <br />
          돈은 돈대로 쓰고 남는 건 없어요
        </AvatarDescription>
        <AvatarInfo>대학생 김모씨 (23세)</AvatarInfo>
      </AvatarContainerColumn>
    </AvatarContainer>
  </Container>
);

export default DividerW;
